 : A new drug of B-cell malignancies ] . 
<mark class="entity" style="background: linear-gradient(90deg, #003300, #ffffff); padding: 0.45em 0.6em; margin: 0 0.25em; line-height: 1; border-radius: 0.35em;">
    DB09053
    <span style="font-size: 0.8em; font-weight: bold; line-height: 1; border-radius: 0.35em; text-transform: uppercase; vertical-align: middle; margin-left: 0.5rem">SUB</span>

 ( Imbruvica ® ) is a first-in-class , orally administered once-daily , that inhibits B-cell antigen receptor signaling downstream of Bruton ' s tyrosine kinase ( 
<mark class="entity" style="background: linear-gradient(90deg, #333366, #ffffff); padding: 0.45em 0.6em; margin: 0 0.25em; line-height: 1; border-radius: 0.35em;">
    Q06187

 ) . 
<mark class="entity" style="background: linear-gradient(90deg, #003300, #ffffff); padding: 0.45em 0.6em; margin: 0 0.25em; line-height: 1; border-radius: 0.35em;">
    DB09053
    <span style="font-size: 0.8em; font-weight: bold; line-height: 1; border-radius: 0.35em; text-transform: uppercase; vertical-align: middle; margin-left: 0.5rem">SUB</span>
</mark>
 has been approved in USA in February 2014 and in France in October 2014 for the treatment of patients with relapsed / refractory mantle cell lymphoma ( Q8WXI8 ) or chronic lymphocytic leukaemia ( CLL ) and for the treatment of patients with CLL and a chromosome 17 deletion ( del 17p ) or 
<mark class="entity" style="background: linear-gradient(90deg, #333366, #ffffff); padding: 0.45em 0.6em; margin: 0 0.25em; line-height: 1; border-radius: 0.35em;">
    P04637
    <span style="font-size: 0.8em; font-weight: bold; line-height: 1; border-radius: 0.35em; text-transform: uppercase; vertical-align: middle; margin-left: 0.5rem">REA</span>
</mark>
 mutation . In clinical studies , ibrutinib induced an impressive overall response rate ( 68 % ) in patients with relapsed / refractory Q8WXI8 ( phase II study ) . In CLL , ibrutinib has shown to significantly improve progression-free survival , response rate and overall survival in patients with relapsed / refractory CLL , including in those with del 17p . 
<mark class="entity" style="background: linear-gradient(90deg, #003300, #ffffff); padding: 0.45em 0.6em; margin: 0 0.25em; line-height: 1; border-radius: 0.35em;">
    DB09053
    <span style="font-size: 0.8em; font-weight: bold; line-height: 1; border-radius: 0.35em; text-transform: uppercase; vertical-align: middle; margin-left: 0.5rem">SUB</span>
</mark>
 had an acceptable tolerability profile . Less than 10 % of patients discontinued their treatment because of adverse events . Results are pending in other B-cell lymphomas subtypes such as in diffuse large B-cell lymphoma and in follicular lymphoma . An approval extension has already been enregistered for Waldenström disease in USA in January 2015 . Given its efficacy and tolerability , ibrutinib is an emerging treatment option for patients with B-cell malignancies .</div>

<mark class="entity" style="background: linear-gradient(90deg, #333366, #ffffff); padding: 0.45em 0.6em; margin: 0 0.25em; line-height: 1; border-radius: 0.35em;">

</mark>
 receptor antagonist , reduces serotonin potentiation of neurally-mediated contractile responses of human detrusor muscle . The aim of this study is to evaluate the potency of piboserod ( SB 207266 ) , a selective 5 - HT ( 4 ) receptor antagonist , at inhibiting the 5 - HT ( 4 ) - mediated potentiating effect of serotonin ( 5 - HT ) on the neurally-mediated contractile responses of human detrusor strips to electrical field stimulations ( O43281 ) . Strips of human detrusor muscle were mounted in Krebs-HEPES buffer under a resting tension of 500 mg and O43281 ( 20 Hz , 1 ms duration at 300 mA for 5 s ) was applied continuously at 1 min intervals . After stabilization of the O43281 - induced contractions , concentration-response curves to 5 - HT ( 0.1 nM - 100 microM ) were constructed in the absence or presence of 1 or 100 nM of piboserod . The experiments were performed in the presence of methysergide ( 1 microM ) and ondansetron ( 3 microM ) to block 5HT ( 1 ) / 5HT ( 2 ) and 5 - HT ( 3 ) receptors , respectively . 5 - HT potentiated the contractile responses to O43281 of human bladder strips in a concentration-dependent manner , with a maximum mean of 60.0+ / -19.9 % of the basal O43281 - evoked contractions . 
<mark class="entity" style="background: linear-gradient(90deg, #CC9966, #ffffff); padding: 0.45em 0.6em; margin: 0 0.25em; line-height: 1; border-radius: 0.35em;">
    DB04873
    <span style="font-size: 0.8em; font-weight: bold; line-height: 1; border-radius: 0.35em; text-transform: uppercase; vertical-align: middle; margin-left: 0.5rem">MEN</span>
</mark>
 did not modify the basal contractions but concentration-dependently antagonized the ability of 5 - HT to enhance bladder strip contractions to O43281 . In presence of 1 and 100 nM of piboserod , the maximal 5 - HT-induced potentiations were reduced to 45.0+ / -7.9 and 38.7+ /-8 . 7 % , respectively . A mean apparent antagonist dissociation constant value ( K ( B ) ) of 0.56+ / -0.09 nM was determined . These data show the ability of piboserod to antagonize with high potency the enhancing properties of 5 - HT on neurally-mediated contractions of isolated human bladder strips . Therefore , the 5 - HT ( 4 ) receptor might represent an attractive pharmacological target for the treatment of overactive bladder .</div>

<h2 style="margin: 0">4</h2>

<h2 style="margin: 0">5</h2>

<div class="entities" style="line-height: 2.5; direction: ltr">Thrombin receptors and their antagonists : an update on the patent literature . IMPORTANCE OF THE FIELD : Thrombin plays a central role in cardiovascular inflammation . Most of the cellular responses to thrombin are mediated by cell surface protease-activated receptors ( PARs ) . Several preclinical studies indicate that PARs are potential targets for treating cardiovascular diseases such as thrombosis , atherosclerosis and restenosis . Among PARs , 
<mark class="entity" style="background: linear-gradient(90deg, #333366, #ffffff); padding: 0.45em 0.6em; margin: 0 0.25em; line-height: 1; border-radius: 0.35em;">
    P25116
    <span style="font-size: 0.8em; font-weight: bold; line-height: 1; border-radius: 0.35em; text-transform: uppercase; vertical-align: middle; margin-left: 0.5rem">REA</span>

 has emerged as an important therapeutic target . AREAS COVERED IN THIS REVIEW : This review covers recent advances in the development of thrombin receptors antagonists . It is focused on the search for
